- input: "TEXT\x1CC00040279\x1C3B8A9944-3429-4306-B\x1C\x1CF3XN\x1CThe Committee and
    its depository, Bank of America, were subjected to a series of instances of fraud
    during the reporting period. Specifically, an unknown individual created and cashed
    fictitious and ultimately forged checks, and cashed the checks during the reporting
    period. These unauthorized disbursements were identified in the course of reconciling
    accounts to prepare the current report, and the Committee notified the bank of
    the issue. Bank of America returned the funds to the Committee's account, but
    this transaction occurred after the close of the reporting period. After discussion
    with the RAD, the Committee is reporting the unauthorized disbursements on this
    report, and will report the return of the funds on the May report.\n"
